import React from "react";
import  ReactDOM  from "react-dom/client";

const element = document.getElementById("root");

const root = ReactDOM.createRoot(element);

function App() {
    let msg = setInterval(() => {
        new Date().toLocaleTimeString()
    }, 1000);
    return <h1>{msg}</h1>;
};

root.render(<App/>);
